export default function Board() {
    const cells = [];
    for (let i = 0; i < 5; i++) {
        for (let j = 0; j < 5; j++) {
            cells.push(
                <div key={`${i}-${j}`} className={`cell-${i}-${j}`}>
                    {`${i}-${j}`}
                </div>
            );
        }
    }

    return (
        <div className="board">
            {cells}
        </div>
    );
}




